import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Use Routes instead of Switch in v6
import MainGrid from './components/MainGrid';  // Import your components as needed
import Home from './components/Home';
import Navbar from './components/NavigationBar';  // Assuming Navbar is in the components folder
import Cart from './components/Cart';    // Example of another route, adjust as necessary
import Products from './components/Products';  // Adjust according to your setup

function App() {
  return (
    <Router>  {/* Wrap the app in the Router component */}
      <div className="App">
        <Navbar />  {/* Navbar will now be within the Router context */}
        <Routes>   {/* Use Routes instead of Switch */}
          <Route path="/" element={<Home />} />   {/* Home route */}
          <Route path="/cart" element={<Cart />} />     {/* Cart route */}
          <Route path="/products" element={<Products />} />  {/* Products route */}
          {/* Add more routes as needed */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
